import { useForm } from "react-hook-form";

function ToDoList() {
  const { register, handleSubmit } = useForm();
  return (
    <div>
      <form onSubmit={handleSubmit()}></form>
      <input {...register("toDo")} placeholder="Write a To Do" />
    </div>
  );
}

export default ToDoList;
